import React from "react";
import { Link } from "react-router-dom";

const Navbar = props => {
  const logout = () => {
    axios.delete("where the data comes from?").then(() => {
      props.setUser(null);
    });
  };

  if (props.user) {
    return (
      <nav>
        <Link to="/">Home</Link>
        <Link onclick={logout} to="/">
          Logout
        </Link>
      </nav>
    );
  }
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="/login">Login</Link>
      <Link to="/signup">Signup</Link>
    </nav>
  );
};

export default Navbar;
